import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function ProductoCard({producto}) {
  return (
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src={producto.productoId.imagen} />
      <Card.Body>
        <Card.Title>{producto.productoId.nombre}</Card.Title>
        <Card.Text>
          ${producto.precioVenta}<br></br>
          Unidades Disponibles: {producto.cantidadStock}
        </Card.Text>
        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>
  );
}

export {ProductoCard};
